import React from 'react';
import './App.css';
import Grooming from './Grooming';

import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';

import { Switch, Route, Link } from 'react-router-dom';


function App() {
  return (
    <div className="App">
      <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
        <Navbar.Brand href="#home">
          <img id='gssLogo'
            src="Zinkys.png"
            width="75"
            height="75"
            className="d-inline-block align-top"
            alt="GSS logo"
          />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link as={Link} to='/grooming'>Grooming</Nav.Link>
            <Nav.Link href="#past">Doggy Daycare</Nav.Link>
            <Nav.Link href="#schedule">Boarding</Nav.Link>
            <Nav.Link eventKey={2} href="#about">Full Price List</Nav.Link>
            <Nav.Link href="#schedule">Requirements</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
      <div>
          <Switch>
            {/* <Route exact path='/' component={Home} /> */}
            <Route path='/grooming' component={Grooming} />
          </Switch>
      </div>
      {/* <h1>Only the best for your pets!</h1>
      <p>Hate leaving your pup at home alone all day when you leave for work? Is the weather bad and you can't take them for a walk? Then bring them on in to our doggy daycare program where he/she can play with other pups while getting the exercise they need and getting extra lovings from humans all day! At Zinky's, your fur baby will not be cooped up on a kennel all day, they'll be in one of our two play areas! We have an outside play area if weather permits, or an indoor play area for those cold and/or rainy days. Play areas are also seperated by the size of your pup, we keep the small dogs together and the big dogs together. </p>
      <p>Our trained staff makes sure every dog gets the attention they deserve. We want every dog to feel loved and safe when they visit Zinky's. To ensure the safety of our visitors, we will first do a temperament test with your pet. After he/she passes the test, they will get placed in the correct play area. From there, a staff member will watch and play with the dogs all day. Simple as that!</p> */}
    </div>
  );

}

export default App;
